I receive through my email.  But I was able to &#39;save as&#39; and then open one
attachment that way!  So.. it is definitely a problem with my email.
Attachments might be blocked due to my settings??  But now I know how to
listen.  So thanks for helping April.  You&#39;re very cool!

k



