From: Kristin &lt;mailto:ckmorris95@...&gt;  Morris 

To: EVP-ITC@yahoogroups &lt;mailto:EVP-ITC@yahoogroups.com&gt; .com 

Sent: Tuesday, April 07, 2009 4:32 PM

Subject: RE: [EVP-ITC] Some more from last month.



No.  I know frank never posts them to the site.  He always just attaches to
email.  So this is where my problem is.. it&#39;s opening attachments.  Let me
see if I can save them to my computer and open that way..



