browser should not have anything to do with it. Wait-unless you are going
straight to the groups site to get posts. I get all posts via email.

----- Original Message ----- 

From: Kristin &lt;mailto:ckmorris95@...&gt;  Morris 

To: EVP-ITC@yahoogroups &lt;mailto:EVP-ITC@yahoogroups.com&gt; .com 

